import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const navigateToSubmission = () => {
    navigate('/submit');
  };

  return (
    <div className="screen">
      <h1>RECIPE APP</h1>
      <button onClick={navigateToSubmission}>Submit a Recipe</button>
    </div>
  );
};

export default Home;
